<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Interactive Workflow Flowchart</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }
        
        body {
            font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            min-height: 100vh;
            padding: 20px;
        }
        
        .container {
            max-width: 1400px;
            margin: 0 auto;
            background: white;
            border-radius: 20px;
            box-shadow: 0 20px 60px rgba(0, 0, 0, 0.3);
            overflow: hidden;
        }
        
        .header {
            background: linear-gradient(135deg, #667eea 0%, #764ba2 100%);
            color: white;
            padding: 30px;
            text-align: center;
        }
        
        .header h1 {
            font-size: 2.5em;
            margin-bottom: 10px;
            text-shadow: 2px 2px 4px rgba(0, 0, 0, 0.2);
        }
        
        .header p {
            font-size: 1.1em;
            opacity: 0.9;
        }
        
        .controls {
            padding: 20px 30px;
            background: #f8f9fa;
            border-bottom: 2px solid #e9ecef;
            display: flex;
            gap: 15px;
            flex-wrap: wrap;
            align-items: center;
        }
        
        .controls button {
            padding: 10px 20px;
            background: #667eea;
            color: white;
            border: none;
            border-radius: 8px;
            cursor: pointer;
            font-size: 14px;
            font-weight: 600;
            transition: all 0.3s ease;
            box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
        }
        
        .controls button:hover {
            background: #764ba2;
            transform: translateY(-2px);
            box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
        }
        
        .controls button:active {
            transform: translateY(0);
        }
        
        .zoom-controls {
            display: flex;
            gap: 10px;
            align-items: center;
            margin-left: auto;
        }
        
        .zoom-level {
            font-weight: 600;
            color: #495057;
            min-width: 50px;
            text-align: center;
        }
        
        .svg-container {
            width: 100%;
            height: calc(100vh - 250px);
            min-height: 600px;
            overflow: auto;
            position: relative;
            background: #ffffff;
            cursor: grab;
        }
        
        .svg-container:active {
            cursor: grabbing;
        }
        
        .svg-wrapper {
            display: inline-block;
            transform-origin: top left;
            transition: transform 0.3s ease;
        }
        
        svg {
            display: block;
            max-width: none;
        }
        
        /* Workflow section styling */
        .workflow-section {
            cursor: pointer;
            transition: opacity 0.3s ease;
        }
        
        .workflow-section:hover {
            opacity: 0.8;
        }
        
        .workflow-section.collapsed {
            opacity: 0.5;
        }
        
        .workflow-section.collapsed > *:not(:first-child) {
            display: none;
        }
        
        /* Highlight on hover */
        .workflow-section:hover {
            filter: drop-shadow(0 0 10px rgba(102, 126, 234, 0.5));
        }
        
        /* Legend */
        .legend {
            padding: 20px 30px;
            background: #f8f9fa;
            border-top: 2px solid #e9ecef;
            display: flex;
            gap: 20px;
            flex-wrap: wrap;
            align-items: center;
            font-size: 14px;
        }
        
        .legend-item {
            display: flex;
            align-items: center;
            gap: 8px;
        }
        
        .legend-icon {
            width: 20px;
            height: 20px;
            border-radius: 4px;
            border: 2px solid #495057;
        }
        
        .legend-icon.clickable {
            background: #667eea;
        }
        
        .legend-icon.collapsed {
            background: #adb5bd;
        }
        
        /* Loading indicator */
        .loading {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            font-size: 1.5em;
            color: #667eea;
        }
        
        /* Tooltip */
        .tooltip {
            position: absolute;
            background: rgba(0, 0, 0, 0.9);
            color: white;
            padding: 8px 12px;
            border-radius: 6px;
            font-size: 12px;
            pointer-events: none;
            z-index: 1000;
            display: none;
            white-space: nowrap;
        }
    </style>
</head>

    <div class="container">
        <div class="header">
            <h1>üîÑ Interactive Workflow Flowchart</h1>
            <p>Click on workflow sections to expand or collapse branches</p>
        </div>
        
        <div class="controls">
            <button onclick="expandAll()">üìñ Expand All</button>
            <button onclick="collapseAll()">üìï Collapse All</button>
            <button onclick="resetView()">üîÑ Reset View</button>
            <button onclick="fitToScreen()">üñ•Ô∏è Fit to Screen</button>
            
            <div class="zoom-controls">
                <button onclick="zoomIn()">üîç+</button>
                <span class="zoom-level" id="zoomLevel">100%</span>
                <button onclick="zoomOut()">üîç‚àí</button>
            </div>
        </div>
        
        <div class="svg-container" id="svgContainer">
            <div class="loading" id="loading">Loading flowchart...</div>
            <div class="svg-wrapper" id="svgWrapper"></div>
        </div>
        
        <div class="legend">
            <div class="legend-item">
                <div class="legend-icon clickable"></div>
                <span>Click section to collapse</span>
            </div>
            <div class="legend-item">

            </div>
            <div class="legend-item">
                <span>üí° Tip: Use mouse wheel to zoom, drag to pan</span>
            </div>
        </div>
    </div>
    
    <div class="tooltip" id="tooltip"></div>

        function initializeSections() {
            const svg = document.querySelector('svg');
            if (!svg) return;
            
            // Find all major workflow sections (groups with IDs starting with "WFQ_")
            const workflowGroups = svg.querySelectorAll('g[id^="WFQ_"], g[id^="Base_"]');
            
            workflowGroups.forEach((group, index) => {
                const sectionId = group.id;
                const sectionName = group.getAttribute('data-name') || sectionId.replace(/_/g, ' ');
                
                // Add class for styling
                group.classList.add('workflow-section');
                group.dataset.sectionName = sectionName;
                group.dataset.expanded = 'true';
                
                // Add click handler
                group.addEventListener('click', (e) => {
                    e.stopPropagation();
                    toggleSection(group);
                });
                
                // Add hover tooltip
                group.addEventListener('mouseenter', (e) => {
                    showTooltip(e, `${sectionName} - Click to ${group.dataset.expanded === 'true' ? 'collapse' : 'expand'}`);
                });
                
                group.addEventListener('mouseleave', () => {
                    hideTooltip();
                });
                
                sections.push({
                    element: group,
                    id: sectionId,
                    name: sectionName
                });
            });
            
            console.log(`Initialized ${sections.length} interactive sections`);
        }
        
        function toggleSection(section) {
            const isExpanded = section.dataset.expanded === 'true';
            
            if (isExpanded) {
                // Collapse: hide all children except the first (usually the title/header)
                section.classList.add('collapsed');
                section.dataset.expanded = 'false';
                
                const children = Array.from(section.children);
                children.forEach((child, index) => {
                    if (index > 0) {
                        child.style.display = 'none';
                    }
                });
            } else {
                // Expand: show all children
                section.classList.remove('collapsed');
                section.dataset.expanded = 'true';
                
                const children = Array.from(section.children);
                children.forEach(child => {
                    child.style.display = '';
                });
            }
        }
        
        function expandAll() {
            sections.forEach(section => {
                if (section.element.dataset.expanded === 'false') {
                    toggleSection(section.element);
                }
            });
        }
        
        function collapseAll() {
            sections.forEach(section => {
                if (section.element.dataset.expanded === 'true') {
                    toggleSection(section.element);
                }
            });
        }
        
        function setupPanZoom() {
            const container = document.getElementById('svgContainer');
            const wrapper = document.getElementById('svgWrapper');
            
            // Mouse wheel zoom
            container.addEventListener('wheel', (e) => {
                e.preventDefault();
                const delta = e.deltaY > 0 ? 0.9 : 1.1;
                const newZoom = Math.min(Math.max(currentZoom * delta, 0.1), 5);
                setZoom(newZoom);
            });
            
            // Pan with mouse drag
            container.addEventListener('mousedown', (e) => {
                if (e.target.closest('.workflow-section')) return; // Don't pan when clicking sections
                
                isPanning = true;
                startX = e.pageX - container.offsetLeft;
                startY = e.pageY - container.offsetTop;
                scrollLeft = container.scrollLeft;
                scrollTop = container.scrollTop;
            });
            
            container.addEventListener('mousemove', (e) => {
                if (!isPanning) return;
                e.preventDefault();
                const x = e.pageX - container.offsetLeft;
                const y = e.pageY - container.offsetTop;
                const walkX = (x - startX) * 2;
                const walkY = (y - startY) * 2;
                container.scrollLeft = scrollLeft - walkX;
                container.scrollTop = scrollTop - walkY;
            });
            
            container.addEventListener('mouseup', () => {
                isPanning = false;
            });
            
            container.addEventListener('mouseleave', () => {
                isPanning = false;
            });
        }
        
        function setZoom(zoom) {
            currentZoom = zoom;
            const wrapper = document.getElementById('svgWrapper');
            wrapper.style.transform = `scale(${zoom})`;
            document.getElementById('zoomLevel').textContent = Math.round(zoom * 100) + '%';
        }
        
        function zoomIn() {
            setZoom(Math.min(currentZoom * 1.2, 5));
        }
        
        function zoomOut() {
            setZoom(Math.max(currentZoom * 0.8, 0.1));
        }
        
        function resetView() {
            setZoom(1);
            const container = document.getElementById('svgContainer');
            container.scrollLeft = 0;
            container.scrollTop = 0;
        }
        
        function fitToScreen() {
            const container = document.getElementById('svgContainer');
            const svg = document.querySelector('svg');
            if (!svg) return;
            
            const containerWidth = container.clientWidth;
            const containerHeight = container.clientHeight;
            const svgWidth = svg.viewBox.baseVal.width;
            const svgHeight = svg.viewBox.baseVal.height;
            
            const scaleX = containerWidth / svgWidth;
            const scaleY = containerHeight / svgHeight;
            const scale = Math.min(scaleX, scaleY) * 0.9; // 90% to leave some margin
            
            setZoom(scale);
            container.scrollLeft = 0;
            container.scrollTop = 0;
        }
        
        function showTooltip(e, text) {
            const tooltip = document.getElementById('tooltip');
            tooltip.textContent = text;
            tooltip.style.display = 'block';
            tooltip.style.left = e.pageX + 15 + 'px';
            tooltip.style.top = e.pageY + 15 + 'px';
        }
        
        function hideTooltip() {
            document.getElementById('tooltip').style.display = 'none';
        }
        
        // Load SVG on page load
        window.addEventListener('load', loadSVG);
        
        // Keyboard shortcuts
        document.addEventListener('keydown', (e) => {
            if (e.key === '+' || e.key === '=') {
                zoomIn();
            } else if (e.key === '-') {
                zoomOut();
            } else if (e.key === '0') {
                resetView();
            } else if (e.key === 'f' || e.key === 'F') {
                fitToScreen();
            } else if (e.key === 'e' || e.key === 'E') {
                expandAll();
            } else if (e.key === 'c' || e.key === 'C') {
                collapseAll();
            }
        });
    </script>
</body>
</html>
